import React, { useState, useEffect } from "react";
import { Link, NavLink } from "react-router-dom";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import Avatar from "@material-ui/core/Avatar";
import ChatBubbleIcon from "@material-ui/icons/ChatBubble";
import LocalGroceryStoreIcon from "@material-ui/icons/LocalGroceryStore";
import "./new.css";
import Doctor from "./newcomponet/Doctor";
import ChatRoom from "./newcomponet/ChatRoom";
import Docter_img from "./newcomponet/Docter_img";
import Pation_img from "./newcomponet/Pation_img";
import Pation from "./newcomponet/Pation";
import UserDetails from "./newcomponet/UserDetails";
import { useSelector, useDispatch } from "react-redux";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    width: "90%",
    margin: "auto",
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: "white",
    backgroundColor: "#9196b5",
  },
}));

function New() {
  let UserEmail_id = useSelector((state) => state.User_Email_id);
  console.log(UserEmail_id);
  const [User, setuser] = useState();
  const [page2, setpage2] = useState(null);
  const [pation_name, setpation_name] = useState(UserEmail_id);
  const [page, setpage] = useState(<Pation />);
  const [pation_Img, setpation_Img] = useState(null);
  const [selectservicetype, setselectservicetype] = useState(null);
  const [selectservice, setselectservice] = useState(null);

  const classes = useStyles();
  //
  useEffect(() => {
    if (localStorage.getItem("userData") !== null) {
      let user = JSON.parse(localStorage.getItem("userData"));
      setuser(user.first_name);
    } else {
      // alert("Please Login Account");
      // window.location.assign("/");
    }
  }, []);

  useEffect(() => {
    if (pation_name) {
      setpage2(
        <UserDetails
          id={pation_name}
          setselectservicetype={setselectservicetype}
          setselectservice={setselectservice}
        />
      );
      setpation_Img(<Pation_img id={pation_name} />);
    } else if (selectservice) {
    }
    return () => {
      setpation_name(null);
    };
  }, [UserEmail_id]);

  //

  return (
    <div style={{ marginBottom: "50px" }}>
      <div className={classes.root}>
        <Grid container spacing={3}>
          <Grid container item sm={12} className="chatbox_container">
            {/*  */}
            <Grid
              item
              container
              sm={1}
              xs={2}
              justify="center"
              className="sidebox_firstbox"
            >
              <Grid
                container
                direction="column"
                justify="flex-start"
                alignItems="center"
              >
                <Grid item style={{ marginBottom: "20px" }}>
                  <Avatar alt={User} src="/static/images/avatar/1.jpg" />
                </Grid>
                <Grid item style={{ marginBottom: "20px" }}>
                  <NavLink exact to="/chatboard" className="link_test">
                    <Paper>
                      <ChatBubbleIcon />
                    </Paper>
                  </NavLink>
                </Grid>
                <Grid item style={{ marginBottom: "20px" }}>
                  <Link to="/chatboard" className="link_test">
                    <Paper>
                      <LocalGroceryStoreIcon />
                    </Paper>
                  </Link>
                </Grid>
              </Grid>
            </Grid>
            {/*  */}

            <Grid
              container
              item
              sm={3}
              xs={5}
              justify="center"
              className="sidebox_secondbox"
            >
              <Grid container direction="column" justify="flex-start">
                <Grid item className="doctor_hading">
                  <h5>patient List</h5>
                </Grid>
                {page}
              </Grid>
            </Grid>
            <Grid item container sm={8} xs={5} className="sidebox_thiredbox">
              <Grid container direction="column" justify="flex-start">
                <Grid item className="doctor_hading">
                  {pation_Img}
                </Grid>
                {page2}
              </Grid>
            </Grid>
          </Grid>
        </Grid>
      </div>
    </div>
  );
}

export default New;
